import React, { useEffect, useState } from 'react';

const DeploymentTable = () => {
  const [deploymentData, setDeploymentData] = useState([]);
  const token = localStorage.getItem('token');

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch('http://10.1.37.114:5000//getDetectionImagesUploadDetails', {
          method: 'POST',
          headers: {
            'x-access-token': token
          }
        });
        const data = await response.json();
        setDeploymentData(data);
      } catch (error) {
        console.error('Error fetching deployment data:', error);
      }
    };

    fetchData();
  }, [token]);

  return (
    <div>
      <h2>Deployment Status</h2>
      <table>
        <thead>
          <tr>
            <th>Date Time</th>
            <th>Deployed Rules</th>
            <th>Status</th>
          </tr>
        </thead>
        <tbody>
          {deploymentData.map((item, index) => (
            <tr key={index}>
              <td>{item.datetime}</td>
              <td>{item.rulesList.map((rule) => rule).join(', ')}</td>
              <td>{item.status}</td>
            </tr>
          ))}
        </tbody>
      </table>
      {/* Add your download section JSX code here */}
    </div>
  );
};

export default DeploymentTable;
